import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <div className="flex justify-between items-center h-32 text-black  ">
      <div className="flex gap-3 items-center mx-16">
        <div className="w-4 h-4 bg-blue-800"></div>
        <p className=" text-2xl    font-bold ">
          Nitin Tundwal{" "}
          <span className=" text-lg font-normal italic">/ WEB DEVELOPER</span>
        </p>
      </div>
      <div className="flex gap-8 mx-16">
        <Link to="/">About Me</Link>
        <Link to="/resume">Resume</Link>
        <Link to="/projects">Projects</Link>
        <Link to="/contact">Contact</Link>
      </div>
    </div>
  );
};

export default Navbar;
